job_summary:
It's a contracting position for a period of 6-12 months.
Manage IFRS 15 accounting elements and revenue recognition;
Liaising with the external auditor;

Prepare accounting entries and maintaining reconciliations;
Develop accounting knowledge and understanding of Finance processes;
Prepare cash and KPI reports;

MBO-BA niveau 4, MBA en studerend voor SPD.
Je hebt affiniteit met cliënten uit het MKB;
Je hebt kwaliteitsbesef en hebt een profesioneel kritische instelling;

Het verzorgen van diverse fiscale aangiften (ib, Vpb en erf);
Het voorbereiden van fiscale adviezen;
Dit accountantskantoor ligt in de Zaanstreek en in totaal…

5+ years of financial accounting experience;
Bachelor or Master degree in accounting/Finance;
Records accounting adjustments, accruals, allocations, currency…

Minimaal een master in accounting of controlling;
In deze functie functioneer je als Business Partner.
Ondersteund door de Financial Controller zorg je ervoor…

Kennis van financial control en accounting;
Een afgeronde opleiding WO Master (e.g. accounting, finance, bedrijfseconomie);
Dit mag je van ons verwachten.

Studerend voor de master opleiding accountancy;
Afgeronde bachelor richting accountancy en/of bedrijfseconomie;
Het opzetten en inrichten van klantendossiers;
